import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Table5.css";

const Table5 = () => {
  const [selectedItem, setSelectedItem] = useState(null);

  const handleItemClick = (item) => {
    setSelectedItem(item);
  };

  const dropdownItems = [
    { label: "1-100", content: "Content for 1-100" },
    { label: "100-1000", content: "Content for 100-1000" },
    { label: "1000-10000", content: "Content for 1000-10000" },
    { label: "10000-50000", content: "Content for 10000-50000" },
    { label: "50000-100000", content: "Content for 50000-100000" },
    { label: "100000 and above", content: "Content for 100000 and above" },
  ];

  const DropdownItem = ({ item }) => {
    return (
      <button
        className="dropdown-item"
        onClick={() => handleItemClick(item)}
      >
        {item.label}
      </button>
    );
  };

  return (
    <>
      <br />
      <nav className="header-container">
        <div className="ui fixed">
          <div className="header-content">
            <div className="back-container">
              <Link to="/reports">
                <button className="btn btn-secondary">Back</button>
              </Link>
            </div>
            <div className="dropdown-container">
              <div className="dropdown">
                <button
                  className="nav-link btn btn-link dropdown-toggle"
                  id="navbarDropdown"
                  data-toggle="dropdown"
                  aria-haspopup="true"
                  aria-expanded="false"
                >
                  Dropdown
                </button>
                <div
                  className="dropdown-menu dropdown-menu-right"
                  aria-labelledby="navbarDropdown"
                >
                  {dropdownItems.map((item, index) => (
                    <DropdownItem item={item} key={index} />
                  ))}
                </div>
              </div>
            </div>
            <div className="dropdown-content">
              {selectedItem && <p>{selectedItem.content}</p>}
            </div>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Table5;
